import React from 'react';
import ReactDOM from 'react-dom';

const AppHeader = () => {
    return (
        <h1>Hello World</h1>
    );
};

const SearchPanel = () => {
    return (
        <input placeholder="search" />
    );
};

const TodoList = () => {
    const item = ['Learn React', 'Build App'];

    return (
        <ul>
            <li>{item[0]}</li>
            <li>{item[1]}</li>
        </ul>
    );
};

const App = () => {
    return (
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    );
};

ReactDOM.render(<App/>, document.getElementById('root'));
